import React, { useEffect, useState } from 'react'
import axiosInstance from '../../baseurl';
import { useNavigate } from 'react-router-dom';

function ViewGym() {
    const [gymdata, setgdata] = useState([
        { name: "gym1", email: "testmail1", empid: 1, gender: "male" },
        { name: "gym2", email: "testmail2", empid: 2, gender: "female" },
      ]);
      const [search,setsearch] = useState('')
      const navigate = useNavigate();
      useEffect(() => {
        if (localStorage.getItem("adminlog") == null) {
          navigate("/Admin/Adminpage");
        }
      }, []);
      
  useEffect(() => {

    axiosInstance
      .post(`/viewGyms`)
      .then((res) => {
        console.log(res, "gym");
        if (res.data.msg == "No Data obtained ") {
          setgdata([]);
        } else {
          setgdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return (
    <div class="container-top">
        <div class="accordion" id="accordionExample">
         <div class="accordion-item">
            <h2 class="accordion-header">
              <button
                class="accordion-button collapsed"
                type="button"
                data-bs-toggle="collapse"
                data-bs-target="#collapseThree"
                aria-expanded="false"
                aria-controls="collapseThree"
              >
                View Gyms

                              <input class="form-control me-2" onChange={(e)=>{setsearch(e.target.value)}} type="search" placeholder="Search" aria-label="Search"/>

              </button>
            </h2>
            <div
              id="collapseThree"
              class="accordion-collapse collapse"
              data-bs-parent="#accordionExample"
            >
              <div class="accordion-body">
              <div class="container text-center">
                {/* cusdata details mapped */}
                {gymdata.length ? (
                 <>
                  <div class="row">
                    <div class="col"><h3> Reg No. </h3></div>
                    <div class="col"><h3> Name </h3></div>
                    <div class="col"><h3> Email  </h3></div>
                    <div class="col"><h3> Contact  </h3></div>
                    <div class="col"><h3> Email  </h3></div>
                    <div class="col"><h3> District  </h3></div>
                  </div>
                  <hr/>
                  </>
                ) : null}
                {gymdata.length ? (
                  gymdata.map((a) => {
                  
                    if(a.name.toLowerCase().includes(search.toLowerCase())){
                      return (
                        <><div class="row">
                        <div class="col"><h3> {a.regno} </h3></div>
                    <div class="col"><h3> {a.name} </h3></div>
                    <div class="col"><h3> Email  </h3></div>
                    <div class="col"><h3> Contact  </h3></div>
                    <div class="col"><h3> Email  </h3></div>
                    <div class="col"><h3> District  </h3></div>
                      </div>
                      <hr/></>
                      );
                    }
                    
                  })
                  
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
              
              </div>
              </div>
            </div>
          </div>
          </div>
    </div>
  )
}

export default ViewGym
